DECLARE @SSISExecutionId BIGINT = 0, @EndExecutionDateTime DATETIME = GETDATE() , @ErrorCount BIGINT = 0, @ErrorExecutionStatusId TINYINT = 4 , @SuccessExecutionStatusId TINYINT = 7, @LoadExecutionStatusId TINYINT = 0; DECLARE @SSISExecutionIdTbl TABLE (SSISExecutionId BIGINT NOT NULL);
UPDATE [le] SET [le].[ExecutionEndDateTime] = @EndExecutionDateTime OUTPUT [Inserted].[SSISServerExecutionId] INTO @SSISExecutionIdTbl FROM [SystemLog].[LoadExecutions] AS [le] WHERE [le].[LoadExecutionId] = @LoadExecutionId;
SELECT @SSISExecutionId = [s].[SSISExecutionId] FROM @SSISExecutionIdTbl AS [s];
-- Retreive Catalog Execution statstics and insert them into [SystemLog].[ExecutionStatistics] table INSERT INTO [SystemLog].[ExecutionStatictics] ( [LoadExecutionId] , [SSISProjectName] , [SSISPackageName] , [SSISPackageStartDateTime] , [SSISPackageEndDateTime] , [DataFlowPathIdString] , [SourceComponentName] , [DestinationComponentName] , [RowsSent] ) SELECT @LoadExecutionId , [e].[project_name] , [eds].[package_name] , [e].[start_time] AS [package_start_time] , [e].[end_time] AS [package_end_time] , [dataflow_path_id_string] , [source_component_name] , [destination_component_name] , SUM([rows_sent]) AS [rows_sent] FROM [$(SSISDB)].[catalog].[execution_data_statistics] AS [eds] INNER JOIN [$(SSISDB)].[catalog].[executions] AS [e] ON [e].[execution_id] = [eds].[execution_id] WHERE [e].[execution_id] = @SSISExecutionId GROUP BY [eds].[package_name] , [e].project_name , [e].[start_time] , [e].[end_time] , [dataflow_path_id_string] , [source_component_name] , [destination_component_name];
--Retrieve execution messages and insert them innsert them into [SystemLog].[ExecutionMessages] table WITH [ExecutionMessage] ( [RoundedMessageTime], [message], [package_name], [event_name], [message_source_name], [subcomponent_name], [package_path], [execution_path], [ExecutionMessageTypeId] ) AS ( SELECT TOP 100 PERCENT CAST(YEAR([message_time]) AS NVARCHAR) + '-' + LEFT('0' + CAST(MONTH([message_time]) AS NVARCHAR) , 2) + '-' + LEFT('0' + CAST(DAY([message_time]) AS NVARCHAR) , 2) + ' ' + LEFT('0' + CAST(DATEPART(HOUR , [message_time]) AS NVARCHAR) , 2) + ':' + LEFT('0' + CAST(DATEPART(MINUTE , [message_time]) AS NVARCHAR) , 2) + ':' + LEFT('0' + CAST(DATEPART(SECOND , [message_time]) AS NVARCHAR) , 2) AS [RoundedMessageTime] , [message] , [package_name] , [event_name] , [message_source_name] , [subcomponent_name] , [package_path] , [execution_path] , [emt].[ExecutionMessageTypeId] FROM [$(SSISDB)].[catalog].[event_messages] AS [em] INNER JOIN [SystemLog].[ExecutionMessageTypes] AS [emt] ON [em].[message_type] = [emt].[SSISDBMessageType] WHERE [operation_id] = @SSISExecutionId ORDER BY [message_time] ) INSERT INTO [SystemLog].[ExecutionMessages] ( [LoadExecutionId] , [ExecutionMessageDateTime] , [ExecutionMessage] , [SSISPackageName] , [SSISEventName] , [SourceComponentName] , [PackagePathIdString] , [ExecutionPathIdString] , [ExecutionMessageTypeId]
) SELECT DISTINCT @LoadExecutionId , [RoundedMessageTime] , [message] , [package_name] , [event_name] , [message_source_name] --, [subcomponent_name] , [package_path] , [execution_path] , [ExecutionMessageTypeId] FROM [ExecutionMessage];
SELECT @ErrorCount = COUNT(*) FROM [SystemLog].[ExecutionMessages] AS [emt] WHERE [emt].[ExecutionMessageTypeId] = 1 AND [emt].LoadExecutionId = @LoadExecutionId;
SET @LoadExecutionStatusId = IIF((@ErrorCount = 0), @SuccessExecutionStatusId, @ErrorExecutionStatusId);
UPDATE [SystemLog].[LoadExecutions] SET [ExecutionStatusId] = @LoadExecutionStatusId WHERE [LoadExecutionId] = @LoadExecutionId;

    --These variables will store id's needed for LoadExecutions 
    DECLARE @FailureStatusId TINYINT = 0 ,
        @RunningStatusId TINYINT = 0 ,
        @LoadDateTime DATETIME = GETDATE() ,
		@LoadEnvironmentId BIGINT = 0;

	--This table varaible will store the newly created LoadExecutionId
    DECLARE @LoadIdTbl TABLE
        (
          LoadExecutionId BIGINT
        );

    --This table variable will contains the newly created LoadEnvironmentId
	DECLARE @LoadEnvironmentIdTbl TABLE (LoadEnvironmentId BIGINT)

     --Get StatusId for Failed loads
    SELECT  @FailureStatusId = s.ExecutionStatusId
    FROM    SystemLog.ExecutionStatus s
    WHERE   s.ExecutionStatusName = N'Failed';

	--Get StatusId for Running loads
    SELECT  @RunningStatusId = s.ExecutionStatusId
    FROM    SystemLog.ExecutionStatus AS s
    WHERE   s.ExecutionStatusName = N'Running';

	--If the SystemLog.Loads table is used, get its LoadDtartDateTime to have a consistent Start date and time in our loads
    IF ( @LoadId <> -1 )
        BEGIN
            SELECT  @LoadDateTime = l.LoadStartDateTime
            FROM    SystemLog.Loads AS l
            WHERE   LoadId = @LoadId;
        END;
	--Check if there are any pending loads for this Application. Terminate them if that's the case.
    IF EXISTS ( SELECT TOP 1
                        1
                FROM    SystemLog.LoadExecutions le
                WHERE   le.LoadId = @LoadId)
        BEGIN
            UPDATE  SystemLog.LoadExecutions
            SET       ExecutionStatusId = @FailureStatusId
			        , ExecutionEndDateTime = @LoadDateTime
            WHERE   LoadId = @LoadId;
        END;

   --Lookup the LoadEnvironmentId for the @LoadEnvironmentName
   SELECT @LoadEnvironmentId = [le].[LoadEnvironmentId]
	FROM [SystemLog].[LoadEnvironments] AS [le]
	WHERE [le].[EnvironmentName] = @LoadEnvironmentName;

	--If it does not exist, insert a new value for @LoadEnvironmentName
	IF(ISNULL(@LoadEnvironmentId, 0) = 0)
	BEGIN
	   INSERT INTO [SystemLog].[LoadEnvironments] ([EnvironmentName]) 
		OUTPUT [Inserted].[LoadEnvironmentId] INTO @LoadEnvironmentIdTbl([LoadEnvironmentId])
	   VALUES (@LoadEnvironmentName);

	   SELECT @LoadEnvironmentId = [LoadEnvironmentId]
	   FROM @LoadEnvironmentIdTbl;
	 END

	--Once we have all foreign keys values, insert a row into [SystemLog].[LoadExecutions] table
    INSERT  INTO SystemLog.LoadExecutions
            ( SSISServerExecutionId ,
              LoadId ,
              ExecutionStatusId ,
			  LoadEnvironmentId ,
              ExecutionStartDateTime ,
              ExecutionEndDateTime
	        )
    OUTPUT  Inserted.LoadExecutionId  --Retreive the Identity LoadExecutionId value
            INTO @LoadIdTbl ( LoadExecutionId )
    VALUES  ( @ServerExecutionId , -- SSISServerExecutionId - bigint
              @LoadId , -- LoadId - bigint
              @RunningStatusId , -- ExecutionStatusId - tinyint
			  @LoadEnvironmentId, -- LoadexecutionId - bigint
              @LoadDateTime , -- ExecutionStartDateTime - datetime
              NULL  -- ExecutionEndDateTime - datetime
	        );

    --Return LoadExecutionId from insert statement above
    SELECT  @LoadExectionId = t.LoadExecutionId
    FROM    @LoadIdTbl AS t;

